#
# Structure for table "choir"
#

DROP TABLE IF EXISTS `choir`;
CREATE TABLE `choir` (
  `ID_CORO` int(15) NOT NULL,
  `NOMBRE` varchar(100) DEFAULT '',
  `AUTOR` varchar(400) DEFAULT 'PENDIENTE',
  `FECHA_ACT` timestamp NULL DEFAULT '2015-08-12 22:15:43',
  `DESCRIPCION` text,
  `NUM_CORO` varchar(20) DEFAULT NULL,
  `ACTIVO` int(1) DEFAULT '2',
  PRIMARY KEY (`ID_CORO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='ALMACENAMIENTO DE COROS';

#
# Data for table "choir"
#

INSERT INTO `choir` VALUES (1,'SLO A DIOS LA GLORIA','LETRA: Rubn Hernndez Dsz, 2001 MUSICA: Ohed Valencia L., 2001','2015-08-12 22:15:43','1. Es el Dios de los ejrcitos \nen quien yo confiar, \ny con cmbalos de gozo \nal Seor ensalzar; \nl despide los relmpagos, \nmas nunca temer, \nl es mi protector.\n<br><br>\n<center>CORO</center>\n<br><br>\nGloria, gloria, aleluya! \nGloria, gloria, aleluya! \nGloria, gloria, aleluya \na nuestro Salvador!\n<br><br>\n2. Con ejrcito no gana \nsus victorias el Seor, \nni con fuerza lucha \nen contra de Satn, \nel tentador; la potencia del Espritu, \nha dicho el Dios de amor, \nes la que vencer.\n<br><br>\n3. En Beln de Palestina \nel Seor Jess naci, \ny despus de treinta aos \nen la cruenta cruz muri; \npero vive para siempre, \npues la tumba ya venci; \nsu nombre alabar.\n<br><br>\n4. El Seor de los seores\nya muy pronto volver,\ny a su pueblo con gran gozo\na las nubes llevar;\ny por siempre moraremos\ntodos en la eternidad\ncon nuestro Salvador.','1',2),(2,'A DIOS SEA LA GLORIA','LETRA Y MSICA: AndrsCrouch, trad. Publicaciones el Faro.','2015-08-11 13:15:43','1. Cmo agradecer lo que hizo el Seor por m? Que, sin merecer, derram su sangre carmes; un coro de un milln de ngeles no expresar mi gratitud, pues lo que soy y un da anhelo ser, lo debo todo a l.<br><br><center>CORO</center><br><br>A Dios sea la gloria,a Dios sea la gloria,a Dios sea la gloriapor lo que hizo por m.Con su sangre me ha salvado,su poder me ha sanado,a Dios sea la gloriapor lo que hizo por m.<br><br>2. Quiero vivir una vida que sea agradable slo a l, y si ganare alguna fama, toda al Calvario la llevar.<br><br><center>Coro para la segunda estrofa</center> <br>Con su sangre me ha salvado su poder me ha sanado, a Dios sea la gloria por lo que hizo por m.','2',2),(3,'ERES DIGNO','LETRA Y MSICA: Pauline M. Lus, arr. Obed Valencia L. 2001','2015-08-11 13:15:43','Eres digno, eres digno, \neres digno, Seor, \nde alabanza, honra y gloria, \ngloria y todo poder. \n<br><br>\nPues todas las cosas \npor ti fueron hechas \ny existen por tu voluntad; \ntodo has creado para tu gloria; \neres digno, Seor.\n','3',2),(4,'DIGNO ES EL CORDERO QUE MURI','LETRA: Basado en Ap. 5:12 Adapt. Don Wyrtzoes tead. MUSICA: Don Wyrtzen','2015-08-11 13:15:43','Digno es el Cordero que muri,\r\ndigno es el Cordero que muri,\r\ndigno es el Cordero que muri \r\nde recibir fuerza, riqueza, \r\nsaber y poder, honra y gloria y bendicin.\r\n<br><br>\r\nDigno es el Cordero, \r\ndigno es el Cordero, \r\ndigno es el Cordero que muri; \r\ndigno es el Cordero.','4',2),(5,'GLORIA, GLORIA, ALELUYA','LETRA: Julia Ward Howe, trad. y adapt.\r\nRoberto C. Savage\r\nMUSICA: Meloda americana, a. Mx\r\n','2015-08-10 23:15:32','1. Es el Dios de los ejrcitos en quien yo confiar, y con cmbalos de gozo al Seor ensalzar; l despide los relmpagos, mas nunca temer, l es mi protector.<br><br><center>CORO</center><br>Gloria, gloria, aleluya! Gloria, gloria, aleluya! Gloria, gloria, aleluya a nuestro Salvador!<br><br>2. Con ejrcito no gana sus victorias el Seor, ni con fuerza lucha en contra de Satn, el tentador; la potencia del Espritu, ha dicho el Dios de amor, es la que vencer.<br><br>3. En Beln de Palestina el Seor Jess naci, y despus de treinta aos en la cruenta cruz muri; pero vive para siempre, pues la tumba ya venci; su nombre alabar.<br><br>4. El Seor de los seoresya muy pronto volver,y a su pueblo con gran gozoa las nubes llevar;y por siempre moraremostodos en la eternidadcon nuestro Salvador.','5',2),(6,'A TI CANTAMOS LA GLORIA, SEOR','LETRA Y MSICA: Brus del Monte, arr, Obed Valencia','2014-08-10 23:15:32','1. A ti cantamos la gloria, Seor, \r\npor tu bondad y por tu grande amor.\r\nEres t digno de todo honor;\r\nfuente de vida, he aqu el clamor.\r\n<br><br>\r\n<center>CORO</center>\r\n<br><br>\r\nOh, Rey del cielo, gran Salvador, \r\na ti te damos nuestro loor. \r\nSer supremo, Dios sin igual, \r\ncon humildad te alabamos, Seor.\r\n<br><br>\r\n2. Al Salvador quien muri en la cruz,\r\na quien con sacrificio nos dio la luz,\r\na quien con sangre preciosa de amor,\r\na Jesucristo, he aqu el clamor.\r\n<br><br>\r\n3. Cantan las aves tu gloria, Seor; \r\nbrillan las flores, expresando loor, \r\ny los que en deuda estn a tu amor, \r\ncantan con gratitud ahora, Seor.','6',2),(7,'GLORIA AL NOMBRE DE CRISTO','LETRA Y MSICA: Roy HicksJr.','2014-08-10 23:15:34','Gloria al nombre de Cristo,\r\ngloria al nombre de Cristo,\r\nes mi Dios, es mi fuerza,\r\nes mi libertador en quin confiar. \r\nGloria al nombre de Cristo.','7',2),(8,'EN MI VIDA GLORIA TE DOY','LETRA Y MSICA: Bob Kilpatrick','2014-08-10 23:15:34','1. En mi vida gloria te doy, \r\ngloria te doy,\r\nen mi vida \r\ngloria te doy, Seor.\r\n<br><br>\r\n2. En mi canto...\r\n<br>\r\n3. En tu iglesia...\r\n<br>\r\n4. En tu mundo...','8',2),(9,'SANTA BIBLIA','P. Castro','2014-08-10 23:15:34','Santa Biblia, para m eres un tesoro aqu;\r\nT contienes con verdad la divina voluntad;\r\nTu me dices lo que soy, de quien vine y a quien voy.\r\n<br><br>\r\nT reprendes mi dudar; t me exhortas sin cesar;\r\nEres faro que a mi pie va guiando por la fe\r\nA las fuentes del amor del bendito Salvador.\r\n<br><br>\r\nEres infalible voz del Espritu de Dios\r\nQue vigor al alma da cuando en afliccin est;\r\nT me enseas a triunfar de la muerte y el pecar.\r\n<br><br>\r\nPor tu santa letra s que con Cristo reinar;\r\nYo que tan indigno soy, por tu luz al cielo voy;\r\nSanta Biblia!, para m eres un tesoro aqu.','9',2),(10,'TU PALABRA ES MI CNTICO','LETRA: Basada en los smbolos bblicos de la palabra de Dios, Felipe Blyckerj.','2015-08-12 22:15:43','1. Tu palabra es mi cntico, \r\nesperanza y gozo da; \r\nes espada, arma divinal \r\ny escudo contra el mal.\r\n<br><br>\r\n<center>CORO</center>\r\n<br><br>\r\nPor la santa Biblia te alabo, \r\nPadre amante, mi Seor. \r\nTe adoro Cristo, Rey eterno; \r\ngracias, oh Consolador.\r\n<br><br>\r\n2. Tu palabra es mi lmpara,\r\nluz divina y gua fiel;\r\nms deseable que oro y plata es, \r\ny ms dulce que la miel.\r\n<br><br>\r\n3. Tu palabra es mi gran mentor, \r\nes semilla, eterno don; \r\nquiero siempre en ella meditar, \r\nhallo all la salvacin.\r\n<br><br>\r\n4. Tu palabra trae libertad, \r\nme consuela en afliccin; \r\ncual martillo y espejo es, \r\nfuego en el corazn.\r\n<br><br>\r\n5. Tu palabra es mi agua y pan,\r\nlimpia el ser y fuerza da; \r\nleche y carne encuentro yo all \r\nque a mi alma sostendr.\r\n','10',2),(11,'TU PALABRA SANTA LLAMA','LETRA Y MSICA: En Rayos de Esperanza, arr. L. Domnguez','2015-08-12 22:15:43','1. Tu palabra santa \r\nllama a todo hombre pecador, \r\npara darle siempre calma \r\ny llenarlo de tu amor; \r\n\r\nsi la acepta con el alma \r\nsentir su corazn \r\nque de veras t le amas, \r\noh, divino Salvador!\r\n<br><br>\r\n<center>Coro</center><br>\r\nCielo, estrellas, mar y tierra, \r\ntodo, todo pasar, \r\nslo tu palabra eterna \r\npor los siglos durar.\r\n<br><br>\r\n2.-Tu palabra salvadora \r\nes verdad, es vida, es luz \r\nque ilumina a toda hora \r\nhasta donde te hallas t. \r\n\r\nHaz que tenga yo la honra \r\nde llevar siempre tu cruz \r\ny alcanzar as la gloria, \r\ndonde moras, mi Jess.\r\n<br><br>\r\n3.-Tu palabra es pan de vida,\r\nes sustento espiritual;\r\ncuando llega al alma herida, \r\nle da alivio, le da paz. \r\n\r\nTodo aquel que la recibe, \r\nnunca, nunca morir, \r\nporque t quieres que viva \r\npor toda la eternidad.\r\n','11',0),(12,'LA LEY DE DIOS PERFECTA ES','LETRA: Basada en el Salmo 19, trad. est. 1-3 Eleazar\r\nZ. Prez, est. 4 Rubn Hernndez D., est. 5\r\nN. Martnez\r\nMUSICA: James McGranahan','2015-08-12 22:15:43','1. La ley de Dios perfecta es,\r\ndel mal convierte al alma; \r\nsus testimonios fieles son, \r\npues brindan dulce calma.\r\n<br><br>\r\n\r\n<center>CORO</center><br>\r\nCunto amo tu ley! \r\nCunto amo tu ley! \r\nes para mi alma \r\ngrata meditacin. \r\n\r\nCunto amo tu ley! \r\nCunto amo tu ley! \r\nEs para m \r\nsin par meditacin.\r\n<br><br>\r\n2. Los estatutos del Seor \r\nsu rectitud proclaman, \r\nsus mandamientos puros son, \r\npues gracia y luz derraman.\r\n<br><br>\r\n3. Muy limpio y puro es el temor \r\nde Dios, por siempre dura; \r\nlos juicios de Jehov, \r\nverdad, y su justicia pura.\r\n<br><br>\r\n4. Es ms preciosa que el metal \r\ny que el oro afinado, \r\nlo que destila del panal \r\ntu ley lo ha superado.\r\n<br><br>\r\n5. En ellos hallan correccin \r\nlos siervos del Seor \r\ny en observarlos con amor \r\nhay grande galardn.\r\n','12',0),(13,'BELLAS PALABRAS DE VIDA','Letra: Philip P. Bliss, trad. Julia Butler\r\nMsica: P.P. Bliss (1874)','2015-08-12 22:15:43','1.- Oh, cantdmelas otra vez\r\nBellas palabras de vida;\r\nHallo en ellas mi gozo y luz,\r\n\r\nBellas palabras de vida.\r\nSi, de luz y vida,\r\nSon sostn y gua.\r\n<br><br>\r\n<center>Coro</center><br>\r\nQu bellas son, qu bellas son!\r\nBellas palabras de vida.\r\nQu bellas son, qu bellas son!\r\nBellas palabras de vida.\r\n<br><br>\r\n2.- Jesucristo a todos da\r\nBellas palabras de vida;\r\nOye su dulce voz, mortal,\r\nBellas palabras de vida.\r\nBondadoso te salva,\r\nY al cielo te llama.\r\n<br><br>\r\n3.- Grato el cntico sonar,\r\nBellas palabras de vida;\r\nTus pecados perdonar,\r\nBellas palabras de vida.\r\nSi, de luz y vida\r\nSon sostn y gua.','13',0),(14,'LIBRO SANTO, POR DIOS INSPIRADO','Letra y Msica:  Rev. P. Arellano, \r\narr. Javier Arjona G.','2015-08-12 22:15:43','1.-Libro Santo por Dios inspirado,\r\nManantial de verdades eternas,\r\nHas venido a romper las cadenas\r\nDel pecado, ignorancia y temor.\r\n\r\nT nos hablas de regias manciones,\r\nDe un destino feliz ms all;\r\nManifiesto a la vista nos pones\r\nLo que al santo su Dios le dar.\r\n<br><br>\r\n2.- Es perfecto el mandato divino,\r\nRectamente encamina a las almas,\r\nAl pequeo a quien t tanto amas,\r\nTus preceptos lo hacen crecer.\r\n\r\nPaz y gozo perfecto las has dado\r\nAl mortal que en tus aguas bebi;\r\nGalardn inmortal ha logrado,\r\nEl que fiel tu mandato guard.\r\n<br><br>\r\n3.-Sigue siempre brillando en mundo,\r\nQue an millones tu luz desconocen,\r\nY a fin que t influencia ellos gocen,\r\nEn el mundo te har circular.\r\n\r\nDios bendito despeja mi mente\r\nPara ver tu perfecta verdad,\r\nHas la guarde por siempre obediente\r\nAlabando tu excelsa bondad.\r\n','14',0),(15,'LMPARA ES A MIS PIES TU PALABRA','LETRA: Basada en el Salmo 119:105, 130,89 MUSICA: Felipe Blyckerj.','2015-08-12 22:15:43','1. Lmpara es a mis pies tu palabra,\r\nlmpara es a mis pies tu palabra, \r\nlmpara es a mis pies tu palabra\r\ny lumbrera a mi camino.\r\n<br><br>\r\n2. La exposicin de tus dichos alumbra,\r\nla exposicin de tus dichos alumbra, \r\nla exposicin de tus dichos alumbra\r\ny hace entender a los simples.\r\n<br><br>\r\n3. Y para siempre, oh Seor, permanece, \r\ny para siempre, oh Seor, permanece, \r\ny para siempre oh Seor, permanece\r\ntu palabra en los cielos.\r\n','15',0),(16,'DE TUS MANDATOS TENGO SED','LETRA: Trad. Juan N. de los Santos\r\nMSICA: William A. Ogden, arr. Miguel C. Meza','2015-08-12 22:15:43','1.- De tus mandatos tengo sed, \r\nreclamo yo tu amor,\r\nmi alma ve y ten merced \r\nde m, buen Salvador;\r\ntu luz divina hazme ver \r\ny tus mandatos conocer.\r\n<br><br>\r\n<center>Coro</center><br>\r\nTu ley es deliciosa\r\ny tus promesas son\r\nms ricas, s, que todo don,\r\ny tu palabra hermosa,\r\nque oro ms preciosa.\r\n<br><br>\r\n2.- Anhela mi alma conocer\r\nardiente tu verdad,\r\ny tus palabras entender\r\ncon celo y claridad;\r\ndelicia tu palabra es\r\ny luz gloriosa de mi ser.\r\n<br><br>\r\n3.-Tu ley yo amo, oh Jess, \r\npues ella goces da; \r\nconstante sigo yo su luz \r\ny mi alma vencer; \r\nms gratas tus palabras son \r\nque todo bien y posesin.\r\n<br><br>\r\n4.-Tu siervo cual oveja es, \r\nsus sendas al errar; \r\nespero yo que a mi alma des \r\nla senda del hogar; \r\ntus estatutos hazme ver, \r\nte quiero yo obedecer.\r\n','16',0),(17,'LOS CIELOS CANTAN TU LOOR','LETRA: tsaac Watts, trad. N. Martinez MUSICA: Lowell Mason','2015-08-12 22:15:43','1. Los cielos cantan tu loor, \r\nlos astros muestran tu poder, \r\nms en tu libro es, oh Seor, \r\ndonde tu nombre es dado ver.\r\n<br><br>\r\n2. Tu sabia mano gua al sol \r\ny a noche y da da lugar; \r\nan ms fiel revelacin \r\nen tu palabra se hallar.\r\n<br><br>\r\n3. En alabanzas sin cesar,\r\nprorrumpe a una la creacin,\r\ny tu justicia y tu verdad \r\nfulgura en limpio corazn.\r\n<br><br>\r\n4. Hasta que pueda el mundo ver, \r\nbajo la gloria de tu faz, \r\na Cristo dando por doquier \r\nsu bendicin, su amor, su paz.','17',2),(18,'VIENE A NOSOTROS LA VIDA','LETRA: De la Misa cubana, Clara Luz Alo, est. 1\r\nRubn Hernndez Daz\r\nMSICA: clara Luz Ajo Lzaro','2015-08-12 22:15:43','<center>CORO</center><br><br>\r\nAleluya, aleluya!\r\nviene a nosotros la vida, \r\nAleluya, aleluya! \r\nviene a nosotros la paz.\r\n<br><br>\r\n1.- Aleluya a ti, oh Cristo, \r\npor tu palabra de amor;\r\ntu ley, Seor, es perfecta,\r\nque a mi alma convirti. \r\n\r\nEs la Biblia, libro santo, \r\nfiel mandamiento de Dios, \r\nms que el oro tu precepto \r\nes el tan preciado don.\r\n<br><br>\r\n2.-Aleluya en el trabajo\r\naleluya en la unidad; \r\ntu palabra nos da vida, \r\ny nos hace caminar, \r\n\r\nluchar por un mundo nuevo, \r\nlleno de amor y verdad, \r\ntu palabra nos impulsa. \r\nAleluya, aleluya!\r\n','18',2),(19,'CON ALMA Y VOZ TE ALABAR','LETRA: Juan N. de los Santos MUSICA: William B. Bradbury','2015-08-12 22:15:43','1.- Con alma y voz te alabar \r\ny yo tus glorias cantar; \r\nadoro yo tu majestad, \r\nte alabar por tu verdad; \r\n\r\nverdad y gracia slo son \r\nen tu palabra bendicin, \r\nen tu palabra bendicin.\r\n<br><br>\r\n2.- Clam a ti por mi salud,\r\nme dio tu ley poder, virtud;\r\nlos reyes prez a ti darn, \r\npues tu palabra escucharn, \r\n\r\ny cantarn con dulce son \r\nlas glorias de tu salvacin, \r\nlas glorias de tu salvacin.\r\n','19',2),(20,'GRATO ES CONTAR LA HISTORIA','LETRA: Katherine Hankey, trad. Juan II. Cabrera\r\nMUSICA: William G. Fischer','2015-08-12 22:15:43','1, Grato es contar la historia \r\ndel celestial favor, \r\nde Cristo y de su gloria, \r\nde Cristo y de su amor. \r\n\r\nMe agrada referirla, \r\npues s que es la verdad; \r\ny nada satisface \r\ncual ella mi ansiedad.\r\n<br><br>\r\n<center>CORO</center><br>\r\nCun bella es esta historia! \r\nmi tema all en la gloria \r\nser ensalzar la historia \r\nde Cristo y de su amor.\r\n<br><br>\r\n2. Grato es contar la historia \r\nms bella que escuch, \r\nms urea, ms hermosa \r\nque cuanto yo so. \r\n\r\nContarla siempre anhelo, \r\npues hay quien nunca oy que, \r\npara hacerle salvo, \r\nCristo en la cruz muri.\r\n<br><br>\r\n3. Grato es contar la historia \r\nque placentera es, \r\ny es ms al repetirla, \r\npreciosa cada vez. \r\n\r\nLa historia, pues, que canto,\r\nod con atencin, \r\nporque es mensaje santo \r\nde eterna salvacin.\r\n<br><br>\r\n4. Grato es contar la historia,\r\nde todas la mejor, \r\nque cuanto ms se escucha,\r\ninfunde ms amor. \r\n\r\nY cuando all en la gloria \r\nentone mi cantar, \r\nser la misma historia\r\nque tanto supe amar.\r\n','20',2),(21,'YO ANHELO, JESS, TU PALABRA GUARDAR','LETRA: Guillernna Morales F. MSICA: Autor desconocido','2015-08-31 12:13:14','1.- Yo anhelo, Jess, \r\ntu palabra guardar, \r\npues lmpara es \r\nque ilumina mi pie, \r\nlumbrera que alumbra \r\nen la va terrenal; \r\nms fina que el oro,\r\n ms dulce que miel.\r\n<br><br>\r\n<center>CORO\r\n</center><br><br>\r\nAydame, oh Cristo, \r\npor siempre a guardar \r\ntus santos mandatos \r\ncon fidelidad; \r\nas mi camino \r\nms limpio ser, \r\npues tus testimonios \r\ndichoso me harn.\r\n<br><br>\r\n2.-Si ordeno mis pasos \r\nconforme a tu ley, \r\nSatn a mis plantas \r\nvencido ser;\r\nsi t me iluminas, \r\npodr comprender \r\nlas mil maravillas \r\nque encierra tu ley.','21',2),(22,'A NUESTRO PADRE DIOS','LETRA: Del libro Estrella de Beln MUSICA: Henry Carey','2015-08-31 12:21:05','1. A nuestro Padre Dios \r\nalcemos nuestra voz, \r\nGloria a l!\r\n\r\nTal fue su amor que dio \r\nal Hijo que muri, \r\nen quien confo yo, \r\nGloria a l!\r\n<br><br>\r\n2. A nuestro Salvador \r\ndemos con fe loor, \r\nGloria a l! \r\n\r\nSu sangre derram; \r\ncon ella me lav \r\ny el cielo me abri, \r\nGloria a l!\r\n<br><br>\r\n3. Espritu de Dios \r\nelevo a ti mi voz \r\nGloria a ti! \r\n\r\nCon celestial fulgor, \r\nme muestras el amor \r\nde Cristo, mi Seor, \r\nGloria a ti!\r\n<br><br>\r\n4. Con gozo y amor \r\ncantemos con fervor \r\nal trino Dios. \r\n\r\nEn la eternidad \r\nmora la Trinidad; \r\nPor siempre alabad \r\nal trino Dios!','22',2),(23,'TE LOAMOS, OH DIOS','LETRA: W. 1. Mackay, trad. H. W. Cragin MUSICA:JohnJ. Husbarid, 1815','2015-08-31 13:01:18','1. Te loamos, oh Dios, \r\nnuestro Padre de amor, \r\npues en Cristo, tu Hijo, \r\nnos diste perdn.\r\n<br><br>\r\n<center>CORO</center>\r\n<br><br>\r\nAleluya, te alabamos, \r\noh, cun grande es tu amor, \r\nAleluya, te adoramos, \r\nbendito Seor.\r\n<br><br>\r\n2. Te loamos, Jess, \r\npues tu trono de luz \r\nt dejaste, por darnos \r\nsalud, en la cruz.\r\n<br><br>\r\n3. Te damos loor, \r\nSanto Consolador, \r\nque nos llenas de gozo \r\ny santo valor.\r\n<br><br>\r\n4. Unidos load \r\na la gran Trinidad, \r\nque es la fuente de gracia, \r\npoder y verdad.\r\n','23',2),(24,'AL REY DE LOS REYES','LETRA Y MSICA En Rayos de Esperanza; est. 3 Rubn Hem, mnd D., arr. Nahum Aquino','2015-08-31 13:05:42','1. Al Rey dejos reyes, \r\nJehov, el glorioso, \r\ncantemos con gozo \r\nen santa Comunin; \r\ncon gran reverencia \r\na l nos lleguemos, \r\nsu nombre ensalcemos \r\nde todo corazn\r\n<br><br>\r\n<center>CORO</center>\r\n<br><br>\r\nGozo y paz \r\nhay en mi corazn, \r\nsu gracia me Salv \r\ny asegur mi salvacin \r\nEs mi anhelo \r\na mi Seor servir, \r\nsu Voluntad cumplir \r\ny para l Siempre vivir. \r\n<br><br>\r\nOh, tan dulce esperanza \r\nnos alienta para seguir \r\nla senda que el Maestro \r\nnos marc con su ejemplo aqu. \r\nAll en lontananza, \r\nal fin de la labor, \r\ndaremos alabanza\r\na nuestro Salvador.\r\n<br><br>\r\n2.-Al Rey de los reyes, \r\nJess, el amante \r\nsublime y triunfante\r\nmundo Volver; \r\ncon todos sus santos, \r\ncon alegres cantos,\r\niglesia anhelante\r\na l se Unir.\r\n<br><br>\r\n3.- Espritu eterno de Dios, \r\ngua santa, \r\na nuestra plegaria atiende, \r\noh Seor;\r\ntu pueblo te adora, \r\ntambin hoy te canta, \r\nenjuga su llanto, \r\noh gran Consolador.\r\n<br><br>\r\n4.- Al Dios solo sabio \r\ny omnipotente, \r\nden todos reverentes \r\nhonor y majestad; \r\npor tus beneficios, \r\nrecibe propicio \r\nmi humilde servicio, \r\ndivina Trinidad.\r\n','24',2),(25,'SANTO, SANTO','LETRA Y MSICA: Jimmy Owens','2015-08-31 13:08:23','1. Santo, Santo, santo, \r\nsanto, santo, \r\nsanto Dios poderos \r\ny levantemos nuestras manos \r\nen seal de gratitud. \r\nSanto, santo, santo, Santo.\r\n<br><br>\r\n2. Santo Padre, santo Padre, \r\nte damos gracias por ser tus hijos; \r\nlevantemos nuestras manos \r\nen seal de gratitud.\r\nSanto, Padre santo Padre.\r\n<br><br>\r\n3. Santo Hijo, Jesucristo, \r\nte damos gracias por redimirnos; \r\nlevantemos nuestras manos \r\nen seal de gratitud. \r\nSanto Hijo, Jesucristo.\r\n<br><br>\r\n4. Santo Espritu, \r\nSanto Espritu, \r\nlimpia y llnanos de tu\r\nlevantemos nuestras manos \r\nen seal de gratitud. \r\nSanto Espritu, Santo Espritu.\r\n<br><br>\r\n5. Aleluya, aleluya, \r\naleluya, oh aleluya; \r\nlevantemos nuestras \r\nmanos en seal de gratitud. \r\nAleluya, aleluya.\r\n','25',2),(26,'CANTAD AL SEOR','LETRA: Autor desconocido, adapt.Rubn Hernndez Daz MSICA: Meloda brasilea, autor desconocido, arr. Javier Arjona G.','2015-08-31 13:09:23','1. Cantad al Seor \r\nun cntico nuevo, \r\ncantad al Seor \r\nen toda la tierra; \r\n\r\ncantad al Seor, \r\nbendito su nombre. \r\nCantad al Seor, \r\ncantad al Seor.\r\n<br><br>\r\n2. Cantad al Creador, \r\nel dueo de todo, \r\nal Padre de amor \r\nque es santo y eterno; \r\n\r\nal mundo l am,\r\nha dado a su Hijo. \r\nCantad al Seor, cantad al Seor.\r\n<br><br>\r\n3. Cantad a Jess, \r\nel digno Cordero, \r\nl nos redimi, \r\npastor amoroso; \r\n\r\nes Cristo, el Rey, \r\npor siempre glorioso. \r\nCantad al Seor, \r\ncantad al Seor.\r\n<br><br>\r\n4. Cantad al Seor, \r\nEspritu Santo, \r\nes nuestro guiador, \r\nl nos justifica, \r\n\r\nes Consolador, \r\nl nos santifica, \r\nCantad al Seor, \r\ncantad al Seor.\r\n<br><br>\r\n5. Cantad al Seor:\r\nAmn, Aleluya! \r\nCantad al Seor:\r\nAmn, Aleluya! \r\n\r\nCantad al Seor \r\nAmn, Aleluya! \r\nCantad al Seor, \r\ncantad al Seor.\r\n','26',2),(27,'GLORIFCATE EN TODO SER ','PENDIENTE','2015-08-31 13:10:35','1. Padre, te amamos \r\ny unidos te adoramos, \r\nglorifcate en todo ser. \r\nGlorifcate, glorifcate, \r\nglorifcate en todo ser\r\n<br><br>\r\n2. Cristo, te amamos \r\ny unidos te adoramos, \r\nglorifcate en todo ser. \r\nGlorifcate, glorifcate, \r\nglorifcate en todo ser.\r\n<br><br>\r\n3. Santo Espritu, \r\nunidos te adoramos, \r\nglorifcate en todo ser. \r\nGlorifcate, glorifcate, \r\nglorifcate en todo ser.\r\n','27',2),(28,'SANTA, BENDITA TRINIDAD','LETRA: Rubn Hernndez Daz','2015-08-31 13:12:16','1. Canto a mi Padre celestial,\r\na ti, mi Dios y Redentor, \r\ndoy alabanzas; t mi esperanza, \r\ngloria al eterno Creador.\r\n<br><br>\r\n2. Canto a Jess, mi Salvador, \r\nal verbo eterno, Emanuel; \r\nl con su muerte cambi mi suerte, \r\ngloria al excelso Redentor.\r\n<br><br>\r\n3. Santa, bendita Trinidad! \r\nA ti mi vida quiero dar; \r\ngloria cantemos y proclamemos, \r\nglorias eternas al Seor.\r\n<br><br>\r\n4. Oh, Santo Espritu de Dios!\r\nt eres el gua en mi vivir;\r\nme santificas, me purificas,\r\nvives en mi, Consolador.\r\n','28',2),(29,'VEN, OH TODOPODEROSO ','LETRA: Henry G. Jackson Msica: Thomas J. Williams','2015-08-31 13:13:10','1. Ven, oh Todopoderoso,\r\nadorable Creador; \r\nPadre santo, carioso, \r\nmanifiesta tu amor. \r\n\r\nA tu trono de clemencia \r\nlevantamos nuestra voz, \r\ntu presencia te pedimos, \r\nnuestro Padre, nuestro Dios.\r\n<br><br>\r\n2. Ven, oh Salvador divino, \r\nDios de nuestra salvacin; \r\nen nosotros haz morada, \r\nvive en nuestro corazn. \r\n\r\nEres t, Jess, benigno, \r\neres infinito amor, \r\nyenos, te suplicamos \r\ny bendcenos, Seor.\r\n<br><br>\r\n3. Ven, Espritu divino, \r\ndanos tu precioso don;\r\nDios Consolador, \r\ninspira paz en todo corazn.\r\n\r\nDe los santos la herencia, \r\ndjanos hallar en ti y la vida de los cielos, \r\ngozaremos ya aqu.\r\n','29',2),(30,'SOLO A TI, DIOS Y SEOR','P. CASTRO','2015-08-31 13:13:54','1. Slo a ti, Dios y Seor, adoramos, adoramos,\r\nY la gloria y el honor tributamos, tributamos,\r\nSlo a Cristo, nuestra luz, acudimos, acudimos,\r\nPor su muerte en la vivimos, revivimos.\r\n<br><br>\r\n2. Un Espritu, no ms nos gobierna, nos gobierna,\r\nY con l, Seor, nos da paz eterna, paz eterna;\r\nEl es fuego celestial, cuya llama, cuya llama\r\nEn amor angelical nos inflama, nos inflama.\r\n<br><br>\r\n3. Disfrutamos tu favor solamente, solamente,\r\nPor Jess, fuente de amor permanente, permanente;\r\nSlo l nos libert de la muerte, de la muerte,\r\nSlo l se declar nuestro Fuerte, nuestro Fuerte.\r\n<br><br>\r\n4. Slo t, oh Creador, Dios eternos, Dios eterno,\r\nNos libraste del furor del infierno, del infierno;\r\nY por esto con placer proclamamos, proclamamos\r\nQue slo en tu gran poder confiamos, confiamos.\r\n','30',2),(31,'PADRE ETERNO','LETRA: Autor desconocido, trad. Pancho Martel, alt.  MSICA: Autor desconocido, arr, Felipe BlyckerJ.','2015-08-31 13:14:36','1. Padre eterno, me postro ante ti, \r\nPadre eterno, me postro ante ti; \r\nyo te amo, te adoro, te rindo loor; \r\nPadre eterno, me postro ante ti.\r\n<br><br>\r\n2. Jesucristo, te alabar, \r\nJesucristo, te alabar; \r\nyo te amo, te adoro, \r\nte rindo loor; Jesucristo, te alabar.\r\n<br><br>\r\n3. Santo Espritu Consolador, \r\nSanto Espritu Consolador; \r\nt me guas, me ayudas y vives en m;\r\nSanto Espritu Consolador.\r\n<br><br>\r\n4. Tres personas en un solo Dios, \r\ntres personas en un solo Dios, \r\nMaravilla sublime, te exaltar! \r\nTres personas en un solo Dios.\r\n','31',2),(32,'OH PADRE, ETERNO DIOS','LETRA: Vicente Mendoza MSICA: Felice de Ciardini','2015-08-31 13:15:41','1. Oh Padre, \r\neterno Dios! \r\nAlzamos nuestra voz \r\nen gratitud \r\n\r\nde cuanto t nos das\r\ncon sin igual amor, \r\nhallando nuestra paz \r\nen ti, Seor.\r\n<br><br>\r\n2. Bendito Salvador! \r\nTe damos \r\ncon amor \r\nel corazn, \r\n\r\ny aqu nos puedes ver \r\nque humildes a tu altar \r\nvenimos a ofrecer \r\nprecioso don.\r\n<br><br>\r\n3. Espritu de Dios! \r\nEscucha \r\nnuestra voz, \r\ny tu bondad \r\n\r\nderrame en nuestro ser \r\ndivina claridad, \r\npara poder vivir \r\nen santidad. Amn.\r\n','32',2),(33,'HIMNO AL PADRE','LETRA: Basado en los nombres bblicos de Dios en Gnesis, Felipe BlykerJ. MUSICA: Felipe Blyker J.','2015-08-31 13:16:52','1. Cantadle a una voz, \r\nomnipotente Dios, \r\nsu nombre es Elohim, \r\nel trino Creador; \r\nJehov es el gran Yo Soy, \r\ny eterno es el Olam,\r\npostraos todos a sus pies, \r\nes nuestro Redentor.\r\n<br><br>\r\n2. Cantadie con amor, \r\naltsimo Seor, \r\nsu nombre es Adonai, \r\ndel mundo Dueo y Rey; \r\nel Dios de bendicin, \r\nnos cuida, El Shaddai; \r\noh, alabadle sin temor, \r\novejas de su grey.\r\n<br><br>\r\n3. Cantad le con fervor, \r\nsupremo y fiel Pastor, \r\nsu nombre es el Elyon, \r\nel gran Gobernador; \r\nel Sempiterno Ser, \r\nnos gua con amor, \r\nload a Jehov Jireh, \r\nde Sion sustentador.\r\n<br><br>\r\n4. Con cnticos a Dios \r\nel Padre, en alta voz, \r\ny al Hijo el Salvador, \r\nmil salmos entonad; \r\ncon himnos ensalzad \r\nal Santo Espritu; \r\ntres veces santo, el trino Dios, \r\nservidle con lealtad.\r\n','33',2),(34,'DE JEHOV CANTAR','LETRA: Est. 11. Arturo Ssvage, est. 2 comit de Celebremos su Gloria MUSICA: James H. Fillrnore','2015-08-31 13:17:48','1. De Jehov cantar yo\r\nlas misericordias, \r\ncantar (can tar), \r\ncantar (cantar);\r\nde Jehov cantar yo \r\nlas misericordias, \r\ngrandes misericordias cantar. \r\nCon mi boca anunciar \r\ntu gran verdad y fidelidad; \r\ncon mi boca anunciar \r\ntu gran verdad \r\npor todos los siglos.\r\n<br><br>\r\n2. Con tu pueblo celebrar \r\ntus maravillas, cantar, \r\n(can tar); cantar (can tar)\r\ncon tu pueblo celebrar \r\ntus maravillas, \r\ns,de tus maravillas cantar. \r\nTu verdad proclamar, \r\npues eres Dios poderoso y fiel; \r\ntu verdad proclamar, \r\npues eres nuestro Rey y escudo.\r\n<br><br>\r\nDe Jehov cantar yo\r\nlas misericordias, cantar (cantar), \r\ncantar (cantar);\r\nde Jehov cantar \r\nyo las misericordias, \r\ngrandes misericordias cantar.\r\n','34',2),(35,'GRANDE ES JEHOV','LETRA Y MSICA: Michael W. Smith, Deborah D. Smith, trad.  Salomn R. Mussiet','2015-08-31 13:18:57','Grande es Jehov y le damos loor \r\npor su grande poder y su amor. \r\nGrande es Jehov y su fidelidad,\r\nsu amor para siempre ser.\r\n<br><br>\r\nGrande es l y digno de gloria! \r\nGrande es y digno de adoracin! \r\nGrande es l! Alcemos la voz\r\nas proclamar:\r\nGrande es Jehov! \r\nGrande es Jehov! \r\n<br><br>\r\nGrande es Jehov y le damos loor \r\npor su grande poder y su amor. \r\nGrande es Jehov y su fidelidad,\r\nsu amor para siempre ser.\r\n<br><br>\r\nGrande eres t y digno de gloria! \r\nGrande eres t y digno de honor! \r\nGrande es l! Levanto mi voz, \r\nelevo mi voz:\r\nGrande es Jehov! \r\nGrande es Jehov!\r\n','35',2),(36,'MARAVILLADO ESTOY','LETRA Y MUSICA: Mark Altrogge, arr. Dbed valenciaL.','2015-08-31 13:19:56','Tu belleza es indescriptible, \r\ndifcil de expresar; \r\ntus obras son incomprensibles, \r\nno hay nadie como t, Seor. \r\nQuin podr entender \r\ntu sabidura?\r\nQuin podr medir \r\ntu profundo amor?\r\n<br><br>\r\nTu belleza es indescriptible, \r\nmajestad, en tu trono ests. \r\nMaravillado estoy de ti, \r\nmaravillado estoy de ti, \r\nsanto Dios, \r\nde quien la gloria es; \r\nmaravillado estoy.','36',2),(37,'AL ESTAR AQU','Letra y Msica: Marcos Witt.  Arr. Obed Valencia L.','2015-08-31 13:21:09','Al estar en la presencia \r\nde tu divinidad,\r\nY al contemplar la hermosura \r\nde tu santidad,\r\nMi espritu se alegra\r\nen tu majestad;\r\nTe adoro a ti, te adoro a ti.\r\n<br><br>\r\nCuando veo la grandeza\r\n de tu dulce amor\r\nY compruebo la pureza \r\nde tu corazn,\r\nMi espritu se alegra\r\nen tu majestad;\r\nTe doro a ti, te adoro a ti.\r\n<br><br>\r\nY al estar aqu, delante de ti,\r\nTe adorar;\r\nPostrado ante ti, mi corazn\r\nTe adora, oh Dios;\r\nY siempre quiero estar \r\npara adorar\r\ny contemplar tu santidad;\r\nte adoro a ti, Seor, te adoro a ti.\r\n','37',2),(38,'CUANTO SOY Y CUANTO ENCIERRO','LETRA: Juan B. Cabrera MSICA: Ch. Gounod','2015-09-01 13:17:00','1. Cuanto soy y cuanto encierro \r\nmanifiesto es para ti, \r\npues tu vista escrutadora, \r\noh Seor!, penetra en m. \r\nSi se agita mi conciencia \r\nt percibes su emocin; \r\nrazonar ves a la mente, \r\nmeditar al corazn.\r\n<br><br>\r\n2. Y hasta el ntimo deseo \r\nque en mi pecho se abrig, \r\nsin que el labio lo expresara, \r\nen tu odo reson; \r\nya despierto, ya dormido, \r\nme circunda tu poder, \r\ny es tu aliento que da vida, \r\nel que aspiro por doquier.\r\n<br><br>\r\n3. Oh gran Dios! \r\ncuando contemplo \r\ntu infinita perfeccin, \r\nel asombro llena mi alma, \r\nse confunde mi razn \r\ny oigo un eco en mi conciencia \r\nque me dice: \"puro s\r\nen deseos, lengua y obras, \r\nporque Dios siempre te ve\".\r\n','38',2),(39,'SANTO, SANTO, GRANDE ETERNO DIOS','LETRA: Fanny J. Crosby 1869, trad. H. C. Bali M1JS1CA: William B. Bradbury, arr. Beontley O. Ackiey','2015-09-01 13:18:40','1. Santo, santo, \r\ngrande eterno Dios! \r\ncon alegra hoy te alabamos, \r\nRey de reyes, grande capitn, \r\ntodopoderoso guerrero. \r\nHonor y gloria, luz y dominio \r\ntributaremos todos a ti.\r\n<br><br>\r\n<center>CORO</center>\r\nSanto, santo eres t, Seor! \r\nDios de las batallas, glorioso!\r\n<br><br>\r\n2. Alabadle cielos, tierra y mar, \r\ntoda su iglesia, sus mensajeros; \r\nalabanzas, cantos de loor \r\nhoy unidos elevaremos. \r\nJuez majestuoso y reverendo, \r\nfuego y vida eres, Seor.\r\n<br><br>\r\n3. Rey de siglos, solo eterno Dios, \r\nveraz y justo, incomprensible,\r\ninmortal, autor de todo bien, \r\neres t el anciano de das. \r\nY para siempre entonaremos \r\nel canto eterno de redencin.','39',2),(40,'QU MAJESTUOSO ES TU NOMBRE','LETRA Y MSICA: Mirhaei W. Smith','2015-09-01 13:19:32','/0h Dios, mi Dios, \r\nqu majestuoso es tu nombre\r\nen la tierra!/\r\n/Aleluya, te alabo, Seor; \r\naleluya, te alabo, Seor;\r\n Prncipe de paz, \r\noh, Dios poderoso!/','40',2),(41,'OH SEOR, T HAS HECHO LOS CIELOS','LETRA Y MSICA: Kay Chance','2015-09-01 13:20:12','Oh Seor, t has hecho los cielos \r\ny la tierra y su gloria.\r\nOh Seor, tu has hecho los cielos \r\ny la tierra con tu poder. \r\nNada es imposible para ti, \r\nnada es imposible para ti. \r\nSupremo Dios, \r\nt eres grande y sabio, Seor. \r\nNada, nada, absolutamente \r\nnada es imposible para ti.','41',2),(42,'CASTILLO FUERTE','Letra y Msica: Martn Lutero, trad. Juan B. Cabrera','2015-09-01 13:21:15','1.- Castillo fuerte es nuestro Dios,\r\nDefensa y buen escudo;\r\nCon su poder nos librar\r\nen todo trance agudo.\r\nCon furia y con afn,\r\nacsanos Satn,\r\npor armas deja ver\r\nastucia y gran poder;\r\ncual l no hay en la tierra.\r\n<br><br>\r\n2.- Nuestro valor es nada aqu,\r\ncon l todo es perdido;\r\nmas con nosotros luchar,\r\nde Dios, el escogido.\r\nEs nuestro Rey Jess,\r\nEl que venci en la cruz,\r\nSeor y Salvador,\r\ny siendo l solo Dios,\r\nl triunfa en la batalla.\r\n<br><br>\r\n3.- Y si demonios mil estn\r\nprontos a devorarnos\r\nno temeremos, porque Dios\r\nsabr cmo ampararnos.\r\nQue muestre su vigor\r\nSatn, y su furor!\r\ndaarnos no podr,\r\npues condenado es ya\r\npor la palabra santa.\r\n<br><br>\r\n4.-Esa palabra del Seor,\r\nque el mundo no apetece,\r\npor el Espritu de Dios\r\nmuy firme permanece.\r\nNos pueden despojar\r\nde bienes, nombre, hogar,\r\nel cuerpo destruir,\r\nms siempre ha de existir\r\nde Dios el reino eterno.','42',2),(43,'SANTO  SANTO  SANTO','J. B. Cabrera, Tr.','2015-09-01 13:22:50','1.Santo!  santo!  santo!  \r\nSeor omnipotente,\r\nsiempre el labio mo \r\nloores te dar.\r\nSanto!  santo!  santo!  \r\nte adoro reverente\r\nDios en tres personas, \r\nbendita Trinidad.\r\n<br><br>\r\n2.Santo!  santo!  santo! \r\nEn numeroso coro,\r\nSantos escogidos \r\nte adoran sin cesar\r\nDe alegra llenos, \r\ny sus coronas de oro\r\nRinden ante el trono \r\ny el cristalino mar.\r\n<br><br>\r\n3.Santo!  santo!  santo!\r\nLa inmensa muchedumbre\r\nDe ngeles que cumplen\r\nTu santa voluntad,\r\nAnte ti se postra,\r\nBaada de tu lumbre,\r\nAnte ti que has sido,\r\nQue eres y sers.\r\n <br><br>\r\n4.Santo!  santo!  santo! \r\npor ms que ests velado,\r\nE imposible sea \r\ntu gloria  contemplar.\r\nSanto t eres solo\r\ny nada hay a tu lado\r\nEn poder perfecto, \r\npureza y caridad.\r\n\r\n4.Santo!  santo!  santo! \r\n la gloria de tu nombre\r\nvemos en tus obras\r\n en cielo, tierra y mar;\r\nSanto!  santo!  santo!  \r\nte adorar todo hombre,\r\nDios en tres personas, \r\nbendita Trinidad.  Amn.','43',2),(44,'TE LOAMOS, TE GLORIFICAMOS','PENDIENTE','2015-09-01 13:24:05','Te loamos, te glorificamos,\r\nTe confesamos eterno Dios y Padre.\r\nToda la tierra con temor  sagrado \r\nSiempre te adora.\r\nY los cielos y los querubines\r\nTodos te ensalzan \r\ncon voces interminables;\r\nRey de los cielos,\r\nLas eternas huestes\r\nSiempre te dicen:\r\n<br><br>\r\n<center>CORO</center>\r\n<br>\r\nSanto, Santo, Santo \r\nSeor ensalzado,\r\nDios fortsimo,\r\ntu majestad y gloria\r\nLlenan los cielos \r\ny te muestras adorado\r\nSobre la tierra. Amn.\r\n','44',2),(45,'GRANDE ES TU FIDELIDAD','PENDIENTE','2015-09-01 13:27:35','1.-Oh, Dios eterno,\r\nTu misericordia\r\nNi una sombra\r\nDe duda tendr;\r\nTu compasin\r\nY bondad nunca fallan\r\n    Y por los siglos\r\n    El mismo sers.\r\n<br><br>\r\n<center>CORO</center>\r\nOh, tu fidelidad!\r\nOh, tu fidelidad!\r\nCada momento \r\nLa veo en m;\r\nNada me falta,\r\nPues todo provees.\r\nGrande, Seor,\r\nEs tu fidelidad!\r\n<br><br>\r\n2.-La noche oscura,\r\n    El sol y la luna\r\n    Las estaciones\r\n    Del ao tambin,\r\n    Unen su canto,\r\n    Cual fieles criaturas,\r\n    Porque eres bueno,\r\n    Por siempre eres fiel.\r\n<br><br>\r\n3.-T me perdonas,\r\n    Me impartes el gozo,\r\n    Tierno me guas\r\n    Por sendas de paz;\r\n    Eres mi fuerza,\r\n    Mi fe, mi reposo,\r\n    Y por los siglos\r\n    Mi Padre sers.\r\n','50',2),(46,'PORQUE T ERES BUENO','PENDIENTE','2015-09-01 13:29:03','Porque t eres bueno,\r\nPorque para siempre\r\nTu misericordia es;\r\nCada maana al despertar,\r\nS que en ti puedo confiar;\r\nMe sostienes por tu gran fidelidad.\r\nPorque t eres  bueno,\r\nPorque tu justicia,\r\nJusticia eterna es,\r\nY en ella yo me deleitar,\r\nEn tu verdad caminar;\r\nPor tu senda de justicia\r\nGuame.','51',2),(47,'TU FIDELIDAD','PENDIENTE','2015-09-01 13:33:37','Tu fidelidad es grande,\r\nTu fidelidad incomparable es;\r\nNadie como t, bendito Dios,\r\nGrande es tu fidelidad.\r\n(se canta tres veces)','52',2),(50,'B','b','2015-09-25 11:56:09','b','342',2),(53,'WEQWE','wqeqeqwe','2015-09-25 13:29:25','<marquee>Hola</marquee>','213123123',2),(54,'SADSADASD','asdasdads','2015-09-28 17:04:00','kljlkjkklkj','21321213213',2),(55,'TEMPORAL','TEMPORAL','2015-10-21 13:04:27','Pega aqu el contenido del coro por favor...SDSDSADASSAASDADDAS','4567',2),(56,'FSDDS','dsfdsfds','2015-10-21 17:41:58','Pega aqu el contenido del coro por favor...dssdfsdsd','2332213',2);

#
# Structure for table "deliveryfailed"
#

DROP TABLE IF EXISTS `deliveryfailed`;
CREATE TABLE `deliveryfailed` (
  `ID_FAILED` int(11) NOT NULL AUTO_INCREMENT,
  `MAIL_TO` varchar(255) DEFAULT NULL,
  `MAIL_FROM` varchar(255) DEFAULT NULL,
  `SUBJECT` varchar(255) DEFAULT NULL,
  `NAME` varchar(255) DEFAULT NULL,
  `BODY` text,
  `TYPE_FAILED` varchar(255) DEFAULT NULL,
  `DATE_SEND` timestamp NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`ID_FAILED`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='Correo no enviados por el sistema.';

