INSERT INTO `property` VALUES (1,'titulo.aviso','El da 9 de agosto de 2015 se llevo a cabo el culto especial de accin de gracias por el VIII aniversario de la Iglesia Nacional Presbiteriana SIDON TIAKIL del municipio de Oschuc, Chiapas. Acto en donde participaron varios grupos musicales y tambin engalan con su presencia este acto cltico, la presidente municipal electa de Oschuc. <a id=\"aviso\" href=\"#\">Seguir leyendo.</a>',0),(2,'detalle.aviso','Contadora Maria Gloria y su gabinete de trabajo, sndicos y regidores. El mensaje de la Palabra de Dios estuvo a cargo del Presidente de la R. Asamblea General el Pbro. Amador Lpez Hernndez y la presentacin de saludos y entrega de reconocimiento a la Iglesia, a cargo del Secretario Pbro. Adolfo Arias Job. Deseamos que el Seor siga bendiciendo y acrecentando la vida de esta amada Iglesia. Nos sentimos muy contentos conviviendo con nuestros hermanos en la fe cristiana, as como disfrutando del convivio preparado para dicho evento. A Dios sea la Gloria.<br><br>\r\n\r\n<center><img width=\"300\" height=\"225\" alt=\"IMG-20150810-WA0001\" src=\"http://presbiterianosag.com.mx/wp-content/uploads/2015/08/IMG-20150810-WA0001-300x225.jpg\" class=\" img-responsive\" style=\"border-radius: 30px\"></center><br><br><center><img width=\"300\" height=\"300\" alt=\"IMG-20150810-WA0002\" src=\"http://presbiterianosag.com.mx/wp-content/uploads/2015/08/IMG-20150810-WA0002-300x300.jpg\" class=\" img-responsive\" style=\"border-radius: 30px\"></center>',0),(3,'rows.query.choir','8',1),(4,'mail.admin','gtrejo.armentax@gmail.com',1),(5,'mail.admin.connect','FALSE',1),(6,'date.system','Fri Oct 23 22:27:00 CDT 2015',1),(7,'mail.admin.date','Fri Oct 23 22:03:37 CDT 2015',1);

